import React from 'react';
import { Link } from 'react-router-dom';
import './PrincipalPage.css';

const PrincipalPage = () => {
    return (
        <div className="principal-page">
            <h1>Welcome to the Operations Management System</h1>
            <div className="links">
                <Link to="/form" className="link-button">Go to Form</Link>
                <Link to="/dashboard" className="link-button">Go to Dashboard</Link>
                {/* Add more links to other services as needed */}
            </div>
        </div>
    );
};

export default PrincipalPage;
